import React from "react";
//import components
import Todo from "./Todo";

// class to store todos
const TodoList = () =>{
    return (
    <div className="todo-container">
      <ul className="todo-list">
        <Todo />
        <Todo />
        <Todo />
        <Todo />
      </ul>
    </div>
    );
};

// exported under the name of TodoList
export default TodoList;
